import React from 'react';
import img from './body.jpg';
import './Boddy.css';

const Body = () => {
  return (
    <>
    <div className='body'>
        <div className='image'>
            <img src={img}/>
            <div className='bgtext'>
            <h2>WELCOME TO</h2>
            <div className='tit'>
                <h1>TEN BILLIONS TREES TSUNAMI </h1>
            </div>
        </div>
        </div>
        
    </div>
    
    
    </>
  )
}

export default Body
